data.value:
Šī komanda tiks izpildīta pēc acs.exe pabegšanas, bet pirms visu rezultātu json-failu nolasīšanas.

Parametri, ko var mainīt:
 [b][mono]{type}[/mono][/b] — sacīkstes tips;
 [b][mono]{car}[/mono][/b] — mašīnas nosaukums;
 [b][mono]{car.id}[/mono][/b] — mašīnas ID;
 [b][mono]{track}[/mono][/b] — trases nosaukums;
 [b][mono]{track.id}[/mono][/b] — trases ID.

Ja tev vajag papildu parametrus, lūdzu sazinies ar mums un mēs tos pievienosim.

Par darba mapi tiks uzstādīta Assetto Corsa mape Dokumentos.

