data.value:
Izmanto ierakstu saglabāšanai un automātiskai saglabāšanai pēc sacīkstes.

Parametri, ko var mainīt:
 [b][mono]{type}[/mono][/b] — sacīkstes tips;
 [b][mono]{car}[/mono][/b] — mašīnas nosaukums;
 [b][mono]{car.id}[/mono][/b] — mašīnas ID;
 [b][mono]{track}[/mono][/b] — trases nosaukuns;
 [b][mono]{track.id}[/mono][/b] — trases ID;
 [b][mono]{date}[/mono][/b] — datums un laiks pareizā formātā;
 [b][mono]{date_ac}[/mono][/b] — datums un laiks AC formātā.

Modifikatori:
 [b][mono]{…:l}[/mono][/b] — mazie burti;
 [b][mono]{…:u}[/mono][/b] — lielie burti;
 [b][mono]{…:0}[/mono][/b] — tikai pirmais simbols.

Piemēri:
 [b][mono]{car.id}_{track.id}_{date_ac}[/mono][/b] — noklusējuma Kunos formāts;
 [b][mono]({type:l0}) {car:l} on {track:l}.acreplay[/mono][/b] — kaut kas līdzīgs “[w] bmw m3 e30 on brands hatch.acreplay”.

Ja tev vajag papildu parametrus, lūdzu sazinies ar mums un mēs tos pievienosim.

[b]Brīdinājums[/b]:
Nelieto tādus simbolus kā “[” vai “]”!

Regulē citu krāsu iespaidu uz mākoņiem:
 • [b]0%:[/b] tiek ņemti vērā tikai mākoņu krāsu efekti;
 • [b]50%:[/b] tiek ņemta vērā 50% krāsa un 50% efekti;
 • [b]100%:[/b] tiek ņemta vērā tikai mākoņu krāsa
